css:
@-moz-document domain("redis.io") {
.site-wrapper {
    background: #1b1b1b;
}
.site-footer a {
    color: #c5c5c5;
}
body {
    color: #ccc;
    background-color: #1b1b1b;
}
[data-_extension-text-contrast="bg"] {
    background-color: #292828 !important;
}
#commands nav select,
#commands nav input {
    border: 1px solid #4d4d4d;
    font-size: 14px;
    margin: 0 5px;
}
button,
input,
optgroup,
select,
textarea {
    color: #e6e6e6;
    font: inherit;
    margin: 0;
    /* background-color: #FFF; */
}
.text .metadata {
    border-left: 3px solid #dfdfdf;
    color: #a7a7a7;
    font-size: 0.9em;
    margin: 0 0 1.5em 0;
    padding: 5px 15px;
    background: #292929;
}
#clients .icon {
    color: #b9b9b9;
}
#clients table td.description {
    color: #bdbdbd;
}
.download-link {
    color: #d8d8d8;
    border: 1px solid #4a4a4a;
}
.text {
    color: #b3b3b3;
}
.site-header {
    background-color: #960000;
}
a {
    /*color: #007ab3;*/
    color: #c50000
}
#commands li a:hover,
#commands li a:focus {
    color: #cfcfcf;
    background: #3b3b3b;
}
#commands li .command .args {
    color: #808080;
}
#commands ul li a {
    background-color: #292828;
}
#commands li a {
    color: #bababa;
}
#commands li .command {
    color: #c50000;
}
#commands nav {
    background-color: #292828;
}
.text pre code {
    background-color: #191919;
    border: 1px solid #282828
}
.text pre code,
.text .example {
    border: 1px solid #282828;
    background-color: #191919;
}
.text .example input {
    color: #b3b3b3;
    background-color: #191919 !important;
}
}
